import React from 'react';
import ReactAnime from 'react-animejs'
const { Anime, stagger } = ReactAnime


export default App => {

    return (
        <div className="App">
            <Anime
                initial={[
                    {
                        targets: "#Box",
                        translateX: 50,
                        easing: "linear"
                    }
                ]}
            >
                <h1>FRANK HUI</h1>
            </Anime>

        </div>
    )

}
